Great White Shark (Ch4)

Science Documentary hosted by Mark Evans and Simon Watt, published by Channel 4 broadcasted as part of CH4 Inside Nature's Giants series in 2013 - English narration


Information
------------------------------

The experts travel to South Africa to dissect a 900kg, 15-foot-long great white shark. Comparative anatomist Joy Reidenberg uncovers the shark's incredible array of senses, including the ability to detect the electro-magnetic field given off by other creatures. Veterinary scientist Mark Evans investigates the origins of the shark's infamous killing bite and, out at sea, a bite force test on a live great white shows just how powerful those jaws really are. Evolutionary biologist Richard Dawkins explains how sharks' teeth and jaws evolved from their outer skin and gill arches. The programme also asks whether the animal's reputation as a man killer is really deserved.

